import Button from "../button/Button";

export default function Header(){
    return (
      <header>
        <h1>Tekila Photo</h1>
        <nav>
          <Button strValue={'קצת עלי'}/>
          <Button strValue={'מה זה לייף סטייל'}/>
          <Button strValue={'גלריה'}/>
          <Button strValue={'מחירון'}/>
          <Button strValue={'דברו איתי'}/>
        </nav>
      </header>
    )
  };
